vector<int> bubbleSort(vector<int> arr, int n) {
	int temp;
	for(int i=0;i<(n-1);i++) {
		for(int j=0;j<(n-i-1);j++) {
			if(arr[j] > arr[j+1]) {
				cout << arr[j] << " swapping " << arr[j+1] << "\n";
				temp = arr[j];
				arr[j]=arr[j+1];
				arr[j+1]=temp;
				cout << arr[j] << " swapped " << arr[j+1]<< "\n";
			}
		}
	}
	return arr;
}


vector<int> iterationSort(vector<int> arr, int n) {
	int temp;
	int pos;
	for(int i=1;i<n;i++) {
		temp = arr[i];
		pos = i;
		while(pos > 0 && temp < arr[pos-1]) {
			arr[pos] = arr[pos-1];
			pos--;
		}
		arr[pos]=temp;
	}
	return arr;
}

void merge(vector<int> &arr, int left, int mid, int right) {
	int l=left;
	int r=mid+1;
	int k=0;
	vector<int> Arr(right-left+1);

	while(l<=mid && r<=right) {
		if(arr[l] > arr[r]) {
			Arr[k++]=arr[r];
			//cout << arr[r] << " if ";
			r++;
		} else {
			Arr[k++]=arr[l];
			//cout << arr[l] << " else ";
			l++;
		}
	}

	for(;l<=mid;l++) {
		Arr[k++]=arr[l];
		//cout << arr[l] << " lfor ";
	}

	for(;r<=right;r++) {
		Arr[k++]=arr[r];
		//cout << arr[r] << " rfor ";
	}
	int j=0;
	for(int i=left;i<=right;i++) {
		arr[i] = Arr[j];
		j++;
	}
	//cout << "\n";
	
}


void mergeSort(vector<int> &arr, int left, int right) {
	int mid;
	if(left < right) {
		mid = (left +right)/2;
		mergeSort(arr, left, mid);
		mergeSort(arr, mid+1, right);
		merge(arr, left,mid,right);
	}
}


vector<int> selectionSort(vector<int> arr, int n) {
	int min;
	int pos;
	int temp;
	for(int i=0;i<n;i++) {
		pos=i;
		for(int j=(i+1);j<n;j++) {
			if(arr[pos] > arr[j]) {
				pos= j;
			}
		}
		temp = arr[i];
		arr[i] = arr[pos];
		arr[pos] = temp;

	}
	return arr;
}

int partition(vector<int> &arr, int l, int h) {
	int pivot,temp;
	int i=l,j=h;
	int mid = (l+h)/2;
	pivot = arr[mid];
	while(i < j) {
		do {
			i++;	
		} while(arr[i] <= pivot);

		do {
			j--;
		} while(arr[j] > pivot);

		if(i < j) {
			temp = arr[i];
			arr[i] = arr[j];
			arr[j] = temp;
		}
	}
	temp = arr[j];
	arr[j] = arr[mid];
	arr[mid] = temp; 

	return j;
}


vector<int> quickSort(vector<int> &arr, int l, int h) {
	int j;
	if(l < h) {
		j = partition(arr,l,h);
		quickSort(arr,l,j);
		quickSort(arr,j+1,h);
	}
	return arr;
}





